import ExpenseItem from "./ExpenseItem";

function NewExpenses(props) {
  for (let i = 0; i < 3; i++) {
    return (
      <div>
        <ExpenseItem
          title={props.title[{ i }].title}
          amount={props.title[{ i }].amount}
          date={props.title[{ i }].date}
        />
      </div>
    );
  }
}

export default NewExpenses;
